values:
so everynight i sit here in my living room with the windows wide open, and almost every other night i have the privelage to&nbsp;listen to the many gay men&nbsp;heard into&nbsp;my neighbors house.
then as some time passes, probably over some wine and cheese or something, they laugh and talk loudly about books and movies and actors or whatever.&nbsp;
then some more time passes and it gets really really quiet but they're all still in there, doing whatever.

i wake up at 9 am every morning and all the cars are still there of course.&nbsp;
1030 comes around, right when im about to get into my car and theres always 2 or 3 of them sitting on the porch in their bathrobes drinking coffee.&nbsp;
i smile and wave because i think in a weird way its kind of cute...?
i love gay men.&nbsp;

i just thought id share that. since tonight is one of those nights.

ive been sleeping all day, having all sorts of weird dreams and waking up shaking and cold, but sweating.&nbsp;
chad tried to make me chug alkaseltzer but what the fuck would a bubbly drink do for me.&nbsp;

i dont know whats going on buttttt i hate doctors and im not going.




gooooodnight.
